import React, { Component } from "react";

class BlocAnimate extends Component {
  state = {
    logoSnate: [
      {
        id: 12,
        img: ""
      }
    ]
  };
  render() {
    return (
      <div
        className="animateMyBg"
        style={{
          backgroundImage: "url('./img/imgYellow.png')",
          backgroundSize: "cover",
          height: "574px"
        }}
      >
        okokk
      </div>
    );
  }
}

export default BlocAnimate;
